import React,{Component} from 'react';
import Post from '../Post/Post';
import './Blog.css';


//basically it displays all the post 
class Blog extends Component{
    render(){
        return (
            <div className="Blog">
                <section>
                    <Post />
                </section>
            </div>
        );

    }
}

export default Blog;
